import React, { Component } from 'react';
import Recipe from "./Recipe";

class RecipeList extends Component {
    render() {
        return (
            <div>
                hello from recpie list
                <Recipe recipes={this.state.recipes}></Recipe>
            </div>
        );
    }
}

export default RecipeList;
